import React from 'react';

const Services = () => {
  return (
    <div className="container py-5">
      <h2 className="text-center mb-4">Our Services</h2>
      <p>We offer the following services:</p>
      <ul>
        <li><strong>Videography:</strong> Capturing events, conferences, and personal moments with professional videography.</li>
        <li><strong>Photography:</strong> Professional photography for all types of events like weddings, corporate gatherings, and more.</li>
        <li><strong>Web Services:</strong> Website development, hosting, and digital marketing services to help your business grow online.</li>
      </ul>
    </div>
  );
};

export default Services;
